pragma solidity ^0.4.17;

contract SmartContract {
  address public owner;

  address public sellerAddress;
  address public buyerAddress;

  string public comment;

  function SmartContract(
    string _sellerAddress,
    string _buyerAddress,
    string _comment
  ) public
  {
    owner = msg.sender;

    sellerAddress = parseAddr(_sellerAddress);
    buyerAddress = parseAddr(_buyerAddress);

    comment = _comment;
  }

  function getSellerAddress() public constant returns (address) {
    return sellerAddress;
  }

  function getBuyerAddress() public constant returns (address) {
    return buyerAddress;
  }

  function getComment() public constant returns (string) {
    return comment;
  }

  function parseAddr(string _a) pure internal returns (address) {
    bytes memory tmp = bytes(_a);
    uint160 iaddr = 0;
    uint160 b1;
    uint160 b2;

    for (uint i = 2; i < 2 + 2 * 20; i += 2) {
      iaddr *= 256;

      b1 = uint160(tmp[i]);
      b2 = uint160(tmp[i + 1]);

      if (b1 >= 97 && b1 <= 102) {
        b1 -= 87;
      } else if (b1 >= 65 && b1 <= 70) {
        b1 -= 55;
      } else if (b1 >= 48 && b1 <= 57) {
        b1 -= 48;
      }

      if (b2 >= 97 && b2 <= 102) {
        b2 -= 87;
      } else if (b2 >= 65 && b2 <= 70) {
        b2 -= 55;
      } else if (b2 >= 48 && b2 <= 57) {
        b2 -= 48;
      }

      iaddr += b1 * 16 + b2;
    }

    return address(iaddr);
  }
}
